import React from 'react';

const TweetsList = ({tweets}) => (
    <>
    <div className="grid-container2">
    {tweets.map((tweet, key) => (
       <>
        <div className="tweet" key={key}>
            <h4>ID {tweet.id} {tweet.user_name}</h4>
            <p>{tweet.text}</p>
        </div>
        </>
    ))}
    </div>
    </>
)

export default TweetsList;
